import { useLocation } from "react-router-dom";
import Header from "../../components/Header";

export default function Reviewchemotherapyorder() {
  const location = useLocation();
  console.log(location.state.newRegimenDetails.regimenName);

  return (
    <div className="flex w-full flex-col gap-[33px] bg-gray-100 pb-[30px] sm:pb-5">
      {/* header section */}
      <Header className="flex items-center justify-center self-stretch border-b border-solid border-gray-400 bg-white-A700 p-2 shadow-xs" />

      {/* main content */}
      <div className="review-container">
        <div className="heading"></div>
        <div className="medications"></div>
        <div className="notes"></div>
        <div className="buttons"></div>
      </div>
    </div>
  );
}
